#require(curl.glsl)

float size = 2.0;//1.0 * smoothstep(1.0, 0.5, life);
vec4 hash = size * random - size * 0.5;
vec3 spatialHash = hash.xyz * uSpatialHashScale;
float temporalHash = hash.w * uTemporalHashScale;

#test Device.system.os == "android" && Device.system.version < 12
temporalHash += random.x;
pos += spatialHash * smoothstep(0.99, 1.0, life);
#endtest

vec3 curl = curlNoise(spatialHash + (pos * uCurlNoiseScale*0.1) + (temporalHash + (time * uCurlTimeScale * 0.1)));
pos += curl * uCurlNoiseSpeed * 0.01 * HZ;
pos += (random.xyz - 0.5) * 0.01 * life * life * life;

